import { LoginAdmin } from "../pages/Admin";
import { Route, Routes } from "react-router-dom";


function RoutesAdmin() {
    return (
        <Routes>
            <Route path="/" element={<Navigate to="/login" />} />
            <Route path="/login" element={<LoginAdmin />} />

        </Routes>

    )
}
export default RoutesAdmin;
